    return (
        <div className="w-screen relative left-[50%] right-[50%] -mx-[50vw] [background-color:oklch(96.833%_0.01405_-72.601)]">
            <div className="flex px-6 gap-8 mx-auto lg:px-8 max-w-7xl md:flex-row items-center justify-center flex-col-reverse py-24 sm:py-32">
                <CallToActionCard1 />
                <CallToActionCard2 />
            </div>
        </div>
    );
}

export default CallToActionSection;
